export default function Autocomplete(theme: any): {
    MuiAutocomplete: {
        styleOverrides: {
            paper: {
                boxShadow: any;
            };
            listbox: {
                padding: any;
                '& .MuiAutocomplete-option': {
                    padding: any;
                    margin: any;
                    borderRadius: any;
                };
            };
        };
    };
};
